import Layout from '../components/Layout';
const Index = (props)=> (
        <Layout>
            <div>
                <h1>Hello Next.js</h1>
                {props.c}
            </div>
        </Layout>
);

Index.getInitialProps = async function(){
    const res = await fetch('https://api.coindesk.com/v1/bpi/currentprice.json');
    const dat = await res.json();
    return{
        bpi: data.bpi
    }
}

export default Index;
